import react,{useState} from 'react'
import Instructionpan from './Instructionpan'
import Emojidata from './Emojidata'
import Emgcard from './Emgcard'
import './Body.css'
const Body=()=>{
const [val1,setVal]=useState(0);
return(
    <>
<div id="Body">
<Instructionpan
Iindex={val1}
/>
<div id="innerBody">
{Emojidata.map((val,index)=>{
const setIndex=()=>{
    setVal(index);
}
    return(
    <div id="EmgCard" style={{display:"flex",flexDirection:"column",color:"white"}} onClick={setIndex}>
    <Emgcard
    Emoji={val}
    Eindex={index}
    />
</div>
    )
})}
</div>
<div id="btnContainer" style={{backgroundColor:"rgba(241, 34, 34, 0.897)",width:"500px",height:"51px",boxShadow:"2px 2px 29px black inset",border:"2px solid rgba(238, 28, 28, 0.897)"}}>
<a href="/" style={{color:"white",textDecoration:"none"}}><h2>Next</h2></a>
</div>
    </div>
    </>
)
}
export default Body
